import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import './dist/css/bootstrap.min.css';

class App extends Component {
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <h1 className="font-weight-bold">Laporan Praktikum Web Design : CSS</h1>
                    <h3>Adam Arthur Faizal</h3>
                    <h4>M3119001 - TI A 2019</h4>
                    <h4>Modul CSS</h4>
                </header>
            </div>
        );
    }
}

export default App;
